import React from 'react';

const ProductList = ({ products, onDelete }) => {
  return (
    <div>
      <h2>Product List</h2>
      <ul>
        {products.map(product => (
          product ? (
            <li key={product.id}>
              <span>{product.name}</span>
              <button onClick={() => onDelete(product.id)}>Delete</button>
            </li>
          ) : null
        ))}
      </ul>
    </div>
  );
};

export default ProductList;
